import React from 'react';
import { BrowserRouter, Routes, Route, } from "react-router-dom";
import './App.css';

import Header from './header';
import Navbar from './navbar';

const App = () => {
  return (
    <>
    <Routes>
      <Route path="/" element={<Header />} />
      <Route path="*" element={<Header />} />
    </Routes>

    </>
  )
}

export default App;
